<html>
<head>
<title>360 viewer</title>
<meta name="viewport"
	content="minimal-ui, width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no" />
<meta name="apple-mobile-web-app-capable" content="yes" />
<meta name="mobile-web-app-capable" content="yes" />
<meta name="apple-mobile-web-app-title" content="360 Viewer">

<style>
body {
	position: absolute;
	margin: 0px;
	top:0px;
	left:0px;
	right:0px;
	bottom:0px;
	
	background-color: black;
	
	-webkit-touch-callout: none; /* iOS Safari */
	-webkit-user-select: none; /* Safari */
	-khtml-user-select: none; /* Konqueror HTML */
	-moz-user-select: none; /* Old versions of Firefox */
	-ms-user-select: none; /* Internet Explorer/Edge */
	user-select: none; /* Non-prefixed version, currently
                                  supported by Chrome, Opera and Firefox */
}

#viewer {
	position: absolute;
	top: 0px;
	left: 0px;
	width: 100%;
	height: 100%;
	box-sizing: border-box;
	opacity: 0;
	transition: opacity 0.4s ease-out;
}

#texture {
	position: absolute;
	bottom: 10px;
	left: 10px;
	
	max-width: 25%;
	max-height: 25%;
	
	transition: height 0.25s ease-in-out;
}

#fovSlider {
	position: absolute;
	bottom: 40px;
	right: 10px;
}

#posSlider {
	position: absolute;
	bottom: 10px;
	right: 10px;
}

#infoChecker {
	position: absolute;
	bottom: 10px;
	right: 180px;
}

</style>
</head>
<body>
	<canvas width="800" height="600" id="viewer"></canvas>
	<!-- <img id="texture" src="./texture-large.jpg" ontouchstart="if (texture.style.height=='20%') texture.style.height='5%'; else texture.style.height='20%';" /> -->
	<!--  <img id="texture" src="https://i.imgur.com/c3Ett5b.jpg" crossorigin="anonymous" /> -->
	
	<img id="texture" crossorigin="anonymous" />
	
	<input id="fovSlider" type="range" min="-1000" max="1000" value="0"/>
	<input id="posSlider" type="range" min="-1000" max="1000" value="0"/>
	<input id="infoChecker" type="checkbox" value="false"/>
	<div style="position:absolute;top:10px;left:10px;color:white;font-family: monospace;" id="status"></div>
